import React from "react";
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';
import 'animate.css/animate.min.css'; // Import animate.css
//import "../../styles/about.css";

function AboutMe() {
  const settings = {
    dots: false,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    autoplay: true,
    autoplaySpeed: 3000,
    centerMode: true,
    centerPadding: '0px',
  };

  return (
    <section id="AboutMe" className="about-section">
      <div className="about-section-content">
        <Slider {...settings}>
          <div className="about-section-img">
            <img src="/img/about-me.png" alt="About Me" className="animate__animated animate__fadeIn" /> {/* Apply animate.css animation class */}
          </div>
          <div className="info-item">
            <span className="info-text animate__animated animate__fadeIn">I am a web developer</span>
          </div>
          <div className="info-item">
            <span className="info-text animate__animated animate__fadeIn">Passionate about coding</span>
          </div>
          <div className="info-item">
            <span className="info-text animate__animated animate__fadeIn">Love learning new technologies</span>
          </div>
          <div className="info-item">
            <span className="info-text animate__animated animate__fadeIn">Enjoy problem-solving</span>
          </div>
          <div className="info-item">
            <span className="info-text animate__animated animate__fadeIn">Dedicated to creating great user experiences</span>
          </div>
        </Slider>
      </div>
    </section>
  );
}

export default AboutMe;
